(194, 61, 'content1', 'Tortoises\r\nTortoises (/ˈtɔːr.təs.ɪz/) are a family, Testudinidae, under the order Testudines and suborder Cryptodira. There are fourteen extant families of the order Testudines, an order of reptile commonly known as turtles, tortoises, and terrapins. The suborder Cryptodira (Greek: hidden neck) is a suborder of Testudines that includes most living tortoises and turtles. Cryptodira differ from Pluerodia \r\nThe carapace is fused to both the vertebrae and ribcage, and tortoises are unique among vertebrates in that the pectoral and pelvic girdles are inside the ribcage rather than outside'),
