(42, 1, '2018-11-02 16:01:58', '2018-11-02 16:01:58', '<b>Owls</b> are <a title=\"Bird\" href=\"https://en.wikipedia.org/wiki/Bird\">birds</a> from the <a title=\"Order (biology)\" href=\"https://en.wikipedia.org/wiki/Order_(biology)\">order</a> <b>Strigiformes</b>, which includes about 200 species of mostly <a title=\"Solitary animal\" href=\"https://en.wikipedia.org/wiki/Solitary_animal\">solitary</a> and <a class=\"mw-redirect\" title=\"Nocturnal animal\" href=\"https://en.wikipedia.org/wiki/Nocturnal_animal\">nocturnal</a> <a class=\"mw-redirect\" title=\"Birds of prey\" href=\"https://en.wikipedia.org/wiki/Birds_of_prey\">birds of prey</a> typified by an upright stance, a large, broad head, <a title=\"Binocular vision\" href=\"https://en.wikipedia.org/wiki/Binocular_vision\">binocular vision</a>, <a class=\"mw-redirect\" title=\"Binaural hearing\" href=\"https://en.wikipedia.org/wiki/Binaural_hearing\">binaural hearing</a>, sharp talons, and <a class=\"mw-redirect\" title=\"Feathers\" href=\"https://en.wikipedia.org/wiki/Feathers\">feathers</a> adapted for silent flight. Exceptions include the diurnal <a title=\"Northern hawk-owl\" href=\"https://en.wikipedia.org/wiki/Northern_hawk-owl\">northern hawk-owl</a> and the gregarious <a title=\"Burrowing owl\" href=\"https://en.wikipedia.org/wiki/Burrowing_owl\">burrowing owl</a>.\r\n\r\nOwls hunt mostly small <a title=\"Mammal\" href=\"https://en.wikipedia.org/wiki/Mammal\">mammals</a>, <a title=\"Insect\" href=\"https://en.wikipedia.org/wiki/Insect\">insects</a>, and other birds, although a few species specialize in hunting <a title=\"Fish\" href=\"https://en.wikipedia.org/wiki/Fish\">fish</a>. They are found in all regions of the Earth except polar ice caps and some remote islands.\r\n\r\nOwls are divided into two <a title=\"Family (biology)\" href=\"https://en.wikipedia.org/wiki/Family_(biology)\">families</a>: the <a title=\"True owl\" href=\"https://en.wikipedia.org/wiki/True_owl\">true (or typical) owl</a> family, Strigidae, and the <a title=\"Barn-owl\" href=\"https://en.wikipedia.org/wiki/Barn-owl\">barn-owl</a> family, Tytonidae.', 'J.U.', '', 'publish', 'closed', 'closed', '', 'by-rhon-cusnon', '', '', '2018-11-04 14:37:33', '2018-11-04 14:37:33', '', 0, 'http://localhost/learning/wordpress/Tokata/?post_type=photos&#038;p=42', 0, 'photos', '', 0),
(43, 1, '2018-11-03 14:27:08', '2018-11-03 14:27:08', 'The <b>cat</b> (<i>Felis catus</i>, or <i>Felis silvestris catus</i>, literally \"woodland cat\"),<sup id=\"cite_ref-4\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Cat#cite_note-4\">[4]</a></sup><sup id=\"cite_ref-MSW3fc_1-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Cat#cite_note-MSW3fc-1\">[1]</a></sup><sup id=\"cite_ref-ITIS_F.c._5-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Cat#cite_note-ITIS_F.c.-5\">[5]</a></sup> often referred to as the <b>domestic cat</b> to distinguish from other <a title=\"Felidae\" href=\"https://en.wikipedia.org/wiki/Felidae\">felids</a> and <a title=\"Felinae\" href=\"https://en.wikipedia.org/wiki/Felinae\">felines</a>, is a small, typically <a title=\"Fur\" href=\"https://en.wikipedia.org/wiki/Fur\">furry</a>, <a title=\"Carnivore\" href=\"https://en.wikipedia.org/wiki/Carnivore\">carnivorous</a> <a title=\"Mammal\" href=\"https://en.wikipedia.org/wiki/Mammal\">mammal</a>. It is often called <b>house cat</b><sup id=\"cite_ref-AHD_6-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Cat#cite_note-AHD-6\">[6]</a></sup> when kept as indoor <a title=\"Pet\" href=\"https://en.wikipedia.org/wiki/Pet\">pet</a> or <b>feral/feral domestic cat</b> when <a class=\"mw-redirect\" title=\"Wild animals\" href=\"https://en.wikipedia.org/wiki/Wild_animals\">wild</a>.<sup id=\"cite_ref-si.edu_7-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Cat#cite_note-si.edu-7\">[7]</a></sup> It is often valued by <a title=\"Human\" href=\"https://en.wikipedia.org/wiki/Human\">humans</a> for companionship and for its ability to hunt <a title=\"Vermin\" href=\"https://en.wikipedia.org/wiki/Vermin\">vermin</a>. There are more than seventy <a title=\"List of cat breeds\" href=\"https://en.wikipedia.org/wiki/List_of_cat_breeds\">cat breeds</a> recognized by various <a title=\"Cat registry\" href=\"https://en.wikipedia.org/wiki/Cat_registry\">cat registries</a>.\r\n\r\nCats are similar in <a title=\"Cat anatomy\" href=\"https://en.wikipedia.org/wiki/Cat_anatomy\">anatomy</a> to the other felids, with a strong flexible body, quick reflexes, sharp teeth and retractable claws adapted to killing small prey. <a title=\"Cat senses\" href=\"https://en.wikipedia.org/wiki/Cat_senses\">Cat senses</a> fit a <a class=\"mw-redirect\" title=\"Crepuscular\" href=\"https://en.wikipedia.org/wiki/Crepuscular\">crepuscular</a> and <a class=\"mw-redirect\" title=\"Predator\" href=\"https://en.wikipedia.org/wiki/Predator\">predatory</a> <a title=\"Ecological niche\" href=\"https://en.wikipedia.org/wiki/Ecological_niche\">ecological niche</a>. Cats can hear sounds too faint or too high in <a title=\"Frequency\" href=\"https://en.wikipedia.org/wiki/Frequency\">frequency</a>for human ears, such as those made by mice and other small animals. They can see in near darkness. Like most other mammals, cats have poorer <a title=\"Color vision\" href=\"https://en.wikipedia.org/wiki/Color_vision\">color vision</a> and a better <a title=\"Olfaction\" href=\"https://en.wikipedia.org/wiki/Olfaction\">sense of smell</a> than humans. Cats, despite being solitary hunters, are a <a class=\"mw-redirect\" title=\"Social animal\" href=\"https://en.wikipedia.org/wiki/Social_animal\">social species</a>, and <a title=\"Cat communication\" href=\"https://en.wikipedia.org/wiki/Cat_communication\">cat communication</a> includes the use of a variety of <a title=\"Animal communication\" href=\"https://en.wikipedia.org/wiki/Animal_communication\">vocalizations</a> (<a title=\"Cat communication\" href=\"https://en.wikipedia.org/wiki/Cat_communication\">mewing</a>, <a title=\"Purr\" href=\"https://en.wikipedia.org/wiki/Purr\">purring</a>, <a title=\"Trill consonant\" href=\"https://en.wikipedia.org/wiki/Trill_consonant\">trilling</a>, hissing, <a title=\"Growling\" href=\"https://en.wikipedia.org/wiki/Growling\">growling</a> and <a title=\"Guttural\" href=\"https://en.wikipedia.org/wiki/Guttural\">grunting</a>) as well as <a title=\"Cat pheromone\" href=\"https://en.wikipedia.org/wiki/Cat_pheromone\">cat pheromones</a> and types of <a class=\"mw-redirect\" title=\"Cat body language\" href=\"https://en.wikipedia.org/wiki/Cat_body_language\">cat-specific body language</a>.<sup id=\"cite_ref-Moelk_8-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Cat#cite_note-Moelk-8\">[8]</a></sup>', 'Rhon Cusnon', '', 'publish', 'closed', 'closed', '', 'rhon-cusnon', '', '', '2018-11-04 14:32:37', '2018-11-04 14:32:37', '', 0, 'http://localhost/learning/wordpress/Tokata/?post_type=photos&#038;p=43', 0, 'photos', '', 0),
