(61, 1, '2018-11-03 14:29:18', '2018-11-03 14:29:18', '<b>Tortoises</b> (<span class=\"nowrap\"><span class=\"IPA nopopups noexcerpt\"><a title=\"Help:IPA/English\" href=\"https://en.wikipedia.org/wiki/Help:IPA/English\">/<span title=\"/ˈ/: primary stress follows\">ˈ</span><span title=\"\'t\' in \'tie\'\">t</span><span title=\"/ɔːr/: \'ar\' in \'war\'\">ɔːr</span><span title=\"/./: syllable break\">.</span><span title=\"\'t\' in \'tie\'\">t</span><span title=\"/ə/: \'a\' in \'about\'\">ə</span><span title=\"\'s\' in \'sigh\'\">s</span><span title=\"/./: syllable break\">.</span><span title=\"/ɪ/: \'i\' in \'kit\'\">ɪ</span><span title=\"\'z\' in \'zoom\'\">z</span>/</a></span></span>) are a family, <b>Testudinidae</b>, under the order Testudines and suborder Cryptodira. There are fourteen extant families of the order Testudines, an order of reptile commonly known as turtles, tortoises, and terrapins. The suborder Cryptodira (Greek<i>: hidden neck</i>) is a suborder of Testudines that includes most living tortoises and turtles. Cryptodira differ from Pluerodia (side-neck turtles) in that they lower their necks and pull the heads straight back into the shells, instead of folding their necks sideways along the body under the shells\' marginals. The testudines are some of the most ancient reptiles alive. Tortoises are shielded from <a class=\"mw-redirect\" title=\"Predator\" href=\"https://en.wikipedia.org/wiki/Predator\">predators</a> by a shell. The top part of the shell is the <a title=\"Carapace\" href=\"https://en.wikipedia.org/wiki/Carapace\">carapace</a>, the underside is the <a title=\"Turtle shell\" href=\"https://en.wikipedia.org/wiki/Turtle_shell#Plastron\">plastron</a>, and the two are connected by the bridge.\r\n\r\nThe carapace is fused to both the vertebrae and ribcage, and tortoises are unique among <a class=\"mw-redirect\" title=\"Vertebrates\" href=\"https://en.wikipedia.org/wiki/Vertebrates\">vertebrates</a> in that the <a class=\"mw-redirect\" title=\"Pectoral girdle\" href=\"https://en.wikipedia.org/wiki/Pectoral_girdle\">pectoral</a> and <a class=\"mw-redirect\" title=\"Pelvic girdle\" href=\"https://en.wikipedia.org/wiki/Pelvic_girdle\">pelvic girdles</a>are inside the ribcage rather than outside. Tortoises can vary in dimension from a few centimeters to two meters. They are usually <a title=\"Diurnality\" href=\"https://en.wikipedia.org/wiki/Diurnality\">diurnal</a>animals with tendencies to be <a class=\"mw-redirect\" title=\"Crepuscular\" href=\"https://en.wikipedia.org/wiki/Crepuscular\">crepuscular</a> depending on the ambient temperatures. They are generally <a class=\"mw-redirect\" title=\"Reclusive\" href=\"https://en.wikipedia.org/wiki/Reclusive\">reclusive</a> animals. Tortoises are the longest living land animal in the world, although the longest living species of tortoise is a matter of debate. <a title=\"Galápagos tortoise\" href=\"https://en.wikipedia.org/wiki/Gal%C3%A1pagos_tortoise\">Galápagos tortoises</a> are noted to live over 150 years, but an <a title=\"Aldabra giant tortoise\" href=\"https://en.wikipedia.org/wiki/Aldabra_giant_tortoise\">Aldabra giant tortoise</a> named <a title=\"Adwaita\" href=\"https://en.wikipedia.org/wiki/Adwaita\">Adwaita</a> may have been the longest living at an estimated 255 years. In general, most tortoise species can live 80–150 years.', 'Liza C.', '', 'publish', 'closed', 'closed', '', 'liza-c', '', '', '2018-11-04 13:39:05', '2018-11-04 13:39:05', '', 0, 'http://localhost/learning/wordpress/Tokata/?post_type=photos&#038;p=61', 0, 'photos', '', 0),
