(81, 1, '2018-11-04 07:10:39', '2018-11-04 07:10:39', '<b>Tortoises</b> (<span class=\"nowrap\"><span class=\"IPA nopopups noexcerpt\"><a title=\"Help:IPA/English\" href=\"https://en.wikipedia.org/wiki/Help:IPA/English\">/<span title=\"/ˈ/: primary stress follows\">ˈ</span><span title=\"\'t\' in \'tie\'\">t</span><span title=\"/ɔːr/: \'ar\' in \'war\'\">ɔːr</span><span title=\"/./: syllable break\">.</span><span title=\"\'t\' in \'tie\'\">t</span><span title=\"/ə/: \'a\' in \'about\'\">ə</span><span title=\"\'s\' in \'sigh\'\">s</span><span title=\"/./: syllable break\">.</span><span title=\"/ɪ/: \'i\' in \'kit\'\">ɪ</span><span title=\"\'z\' in \'zoom\'\">z</span>/</a></span></span>) are a family, <b>Testudinidae</b>, under the order Testudines and suborder Cryptodira. There are fourteen extant families of the order Testudines, an order of reptile commonly known as turtles, tortoises, and terrapins. The suborder Cryptodira (Greek<i>: hidden neck</i>) is a suborder of Testudines that includes most living tortoises and turtles. Cryptodira differ from Pluerodia (side-neck turtles) in that they lower their necks and pull the heads straight back into the shells, instead of folding their necks sideways along the body under the shells\' marginals. The testudines are some of the most ancient reptiles alive. Tortoises are shielded from <a class=\"mw-redirect\" title=\"Predator\" href=\"https://en.wikipedia.org/wiki/Predator\">predators</a> by a shell. The top part of the shell is the <a title=\"Carapace\" href=\"https://en.wikipedia.org/wiki/Carapace\">carapace</a>, the underside is the <a title=\"Turtle shell\" href=\"https://en.wikipedia.org/wiki/Turtle_shell#Plastron\">plastron</a>, and the two are connected by the bridge.\n\n&nbsp;', 'Liza C.', '', 'inherit', 'closed', 'closed', '', '61-autosave-v1', '', '', '2018-11-04 07:10:39', '2018-11-04 07:10:39', '', 61, 'http://localhost/learning/wordpress/Tokata/2018/11/04/61-autosave-v1/', 0, 'revision', '', 0),
