(88, 1, '2018-11-04 14:29:01', '2018-11-04 14:29:01', 'The <b>cat</b> (<i>Felis catus</i>, or <i>Felis silvestris catus</i>, literally \"woodland cat\"),<sup id=\"cite_ref-4\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Cat#cite_note-4\">[4]</a></sup><sup id=\"cite_ref-MSW3fc_1-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Cat#cite_note-MSW3fc-1\">[1]</a></sup><sup id=\"cite_ref-ITIS_F.c._5-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Cat#cite_note-ITIS_F.c.-5\">[5]</a></sup> often referred to as the <b>domestic cat</b> to distinguish from other <a title=\"Felidae\" href=\"https://en.wikipedia.org/wiki/Felidae\">felids</a> and <a title=\"Felinae\" href=\"https://en.wikipedia.org/wiki/Felinae\">felines</a>, is a small, typically <a title=\"Fur\" href=\"https://en.wikipedia.org/wiki/Fur\">furry</a>, <a title=\"Carnivore\" href=\"https://en.wikipedia.org/wiki/Carnivore\">carnivorous</a> <a title=\"Mammal\" href=\"https://en.wikipedia.org/wiki/Mammal\">mammal</a>. It is often called <b>house cat</b><sup id=\"cite_ref-AHD_6-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Cat#cite_note-AHD-6\">[6]</a></sup> when kept as indoor <a title=\"Pet\" href=\"https://en.wikipedia.org/wiki/Pet\">pet</a> or <b>feral/feral domestic cat</b> when <a class=\"mw-redirect\" title=\"Wild animals\" href=\"https://en.wikipedia.org/wiki/Wild_animals\">wild</a>.<sup id=\"cite_ref-si.edu_7-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Cat#cite_note-si.edu-7\">[7]</a></sup> It is often valued by <a title=\"Human\" href=\"https://en.wikipedia.org/wiki/Human\">humans</a> for companionship and for its ability to hunt <a title=\"Vermin\" href=\"https://en.wikipedia.org/wiki/Vermin\">vermin</a>. There are more than seventy <a title=\"List of cat breeds\" href=\"https://en.wikipedia.org/wiki/List_of_cat_breeds\">cat breeds</a> recognized by various <a title=\"Cat registry\" href=\"https://en.wikipedia.org/wiki/Cat_registry\">cat registries</a>.\n\nCats are similar in <a title=\"Cat anatomy\" href=\"https://en.wikipedia.org/wiki/Cat_anatomy\">anatomy</a> to the other felids, with a strong flexible body, quick reflexes, sharp teeth and retractable claws adapted to killing small prey. <a title=\"Cat senses\" href=\"https://en.wikipedia.org/wiki/Cat_senses\">Cat senses</a> fit a <a class=\"mw-redirect\" title=\"Crepuscular\" href=\"https://en.wikipedia.org/wiki/Crepuscular\">crepuscular</a> and <a class=\"mw-redirect\" title=\"Predator\" href=\"https://en.wikipedia.org/wiki/Predator\">predatory</a> <a title=\"Ecological niche\" href=\"https://en.wikipedia.org/wiki/Ecological_niche\">ecological niche</a>. Cats can hear sounds too faint or too high in <a title=\"Frequency\" href=\"https://en.wikipedia.org/wiki/Frequency\">frequency</a>for human ears, such as those made by mice and other small animals. They can see in near darkness. Like most other mammals, cats have poorer <a title=\"Color vision\" href=\"https://en.wikipedia.org/wiki/Color_vision\">color vision</a> and a better <a title=\"Olfaction\" href=\"https://en.wikipedia.org/wiki/Olfaction\">sense of smell</a> than humans. Cats, despite being solitary hunters, are a <a class=\"mw-redirect\" title=\"Social animal\" href=\"https://en.wikipedia.org/wiki/Social_animal\">social species</a>, and <a title=\"Cat communication\" href=\"https://en.wikipedia.org/wiki/Cat_communication\">cat communication</a> includes the use of a variety of <a title=\"Animal communication\" href=\"https://en.wikipedia.org/wiki/Animal_communication\">vocalizations</a> (<a title=\"Cat communication\" href=\"https://en.wikipedia.org/wiki/Cat_communication\">mewing</a>, <a title=\"Purr\" href=\"https://en.wikipedia.org/wiki/Purr\">purring</a>, <a title=\"Trill consonant\" href=\"https://en.wikipedia.org/wiki/Trill_consonant\">trilling</a>, hissing, <a title=\"Growling\" href=\"https://en.wikipedia.org/wiki/Growling\">growling</a> and <a title=\"Guttural\" href=\"https://en.wikipedia.org/wiki/Guttural\">grunting</a>) as well as <a title=\"Cat pheromone\" href=\"https://en.wikipedia.org/wiki/Cat_pheromone\">cat pheromones</a> and types of <a class=\"mw-redirect\" title=\"Cat body language\" href=\"https://en.wikipedia.org/wiki/Cat_body_language\">cat-specific body language</a>.<sup id=\"cite_ref-Moelk_8-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Cat#cite_note-Moelk-8\">[8]</a></sup>', 'Rhon Cusnon', '', 'inherit', 'closed', 'closed', '', '43-autosave-v1', '', '', '2018-11-04 14:29:01', '2018-11-04 14:29:01', '', 43, 'http://localhost/learning/wordpress/Tokata/2018/11/04/43-autosave-v1/', 0, 'revision', '', 0),
