(92, 1, '2018-11-04 14:34:02', '2018-11-04 14:34:02', '<b>Owls</b> are <a title=\"Bird\" href=\"https://en.wikipedia.org/wiki/Bird\">birds</a> from the <a title=\"Order (biology)\" href=\"https://en.wikipedia.org/wiki/Order_(biology)\">order</a> <b>Strigiformes</b>, which includes about 200 species of mostly <a title=\"Solitary animal\" href=\"https://en.wikipedia.org/wiki/Solitary_animal\">solitary</a> and <a class=\"mw-redirect\" title=\"Nocturnal animal\" href=\"https://en.wikipedia.org/wiki/Nocturnal_animal\">nocturnal</a> <a class=\"mw-redirect\" title=\"Birds of prey\" href=\"https://en.wikipedia.org/wiki/Birds_of_prey\">birds of prey</a> typified by an upright stance, a large, broad head, <a title=\"Binocular vision\" href=\"https://en.wikipedia.org/wiki/Binocular_vision\">binocular vision</a>, <a class=\"mw-redirect\" title=\"Binaural hearing\" href=\"https://en.wikipedia.org/wiki/Binaural_hearing\">binaural hearing</a>, sharp talons, and <a class=\"mw-redirect\" title=\"Feathers\" href=\"https://en.wikipedia.org/wiki/Feathers\">feathers</a> adapted for silent flight. Exceptions include the diurnal <a title=\"Northern hawk-owl\" href=\"https://en.wikipedia.org/wiki/Northern_hawk-owl\">northern hawk-owl</a> and the gregarious <a title=\"Burrowing owl\" href=\"https://en.wikipedia.org/wiki/Burrowing_owl\">burrowing owl</a>.\n\nOwls hunt mostly small <a title=\"Mammal\" href=\"https://en.wikipedia.org/wiki/Mammal\">mammals</a>, <a title=\"Insect\" href=\"https://en.wikipedia.org/wiki/Insect\">insects</a>, and other birds, although a few species specialize in hunting <a title=\"Fish\" href=\"https://en.wikipedia.org/wiki/Fish\">fish</a>. They are found in all regions of the Earth except polar ice caps and some remote islands.\n\nOwls are divided into two <a title=\"Family (biology)\" href=\"https://en.wikipedia.org/wiki/Family_(biology)\">families</a>: the <a title=\"True owl\" href=\"https://en.wikipedia.org/wiki/True_owl\">true (or typical) owl</a> family, Strigidae, and the <a title=\"Barn-owl\" href=\"https://en.wikipedia.org/wiki/Barn-owl\">barn-owl</a> family, Tytonidae.', 'J.U.', '', 'inherit', 'closed', 'closed', '', '42-autosave-v1', '', '', '2018-11-04 14:34:02', '2018-11-04 14:34:02', '', 42, 'http://localhost/learning/wordpress/Tokata/2018/11/04/42-autosave-v1/', 0, 'revision', '', 0),
