(102, 1, '2018-11-08 15:35:40', '2018-11-08 15:35:40', 'Our website templates are created with inspiration, checked for quality and originality and meticulously sliced and coded. What´s more, they´re absolutely free! You can do a lot with them. You can modify them. You can use them to design websites for clients, so long as you agree with the Terms of Use. You can even remove all our links if you want to.', 'We Have Free Templates for Everyone', '', 'publish', 'closed', 'closed', '', 'testing', '', '', '2018-11-08 15:38:03', '2018-11-08 15:38:03', '', 101, 'http://localhost/learning/wordpress/Tokata/?post_type=tabs_children&#038;p=102', 0, 'tabs_children', '', 0),
(103, 1, '2018-11-08 15:38:41', '2018-11-08 15:38:41', 'Looking for more templates? Just browse through all our Free Website Templates and find what you´re looking for. But if you don´t find any website template you can use, you can try our Free Web Design service and tell us all about it. Maybe you´re looking for something different, something special. And we love the challenge of doing something different and something special.', 'We Have More Templates for You', '', 'publish', 'closed', 'closed', '', 'we-have-more-templates-for-you', '', '', '2018-11-08 15:38:41', '2018-11-08 15:38:41', '', 101, 'http://localhost/learning/wordpress/Tokata/?post_type=tabs_children&#038;p=103', 0, 'tabs_children', '', 0),
