(121, 1, '2018-12-17 08:40:26', '2018-12-17 08:40:26', 'ក្រុមហ៊ុន BMW AG និង Porsche បាន​បង្ហាញ​ស្ថានីយ​សាក​ថ្ម​ល្បឿន​លឿន...', 'ស្ថានីយ​សាក​ថ្ម​ល្បឿន​លឿនថ្មី ​ប្រើ​ពេល ៣ នាទី រត់​បាន ១០០ គីឡូម៉ែត្', '', 'publish', 'closed', 'closed', '', '%e1%9e%9f%e1%9f%92%e1%9e%90%e1%9e%b6%e1%9e%93%e1%9e%b8%e1%9e%99%e2%80%8b%e1%9e%9f%e1%9e%b6%e1%9e%80%e2%80%8b%e1%9e%90%e1%9f%92%e1%9e%98%e2%80%8b%e1%9e%9b%e1%9f%92%e1%9e%94%e1%9e%bf%e1%9e%93%e2%80%8b', '', '', '2018-12-17 08:40:26', '2018-12-17 08:40:26', '', 0, 'http://localhost/learning/wordpress/Tokata/?post_type=entertain&#038;p=121', 0, 'entertain', '', 0),
