(123, 1, '2018-12-17 08:41:23', '2018-12-17 08:41:23', 'ស្មាតហ្វូន Pixel 3 របស់ Google, កម្មវិធី Lightroom របស់ Adobe និង iPhone ម៉ូដែល​ថ្មី សុទ្ធតែ​មាន​ការ​ចិត្ត​ទុក​ដាក់​ជាមួយ​នឹង​ទម្រង់​រូបភាព​ដើម​នេះ​។\r\n\r\nក្នុង​ចំណោម​អ្នក​ថតរូប​អាជីព ១ ៨០០​នាក់​នៅ​សហរដ្ឋអាមេរិក មាន ៦៨% ថត​ប្រើ​ទម្រង់ RAW, ២០% ថត​លាយ​គ្នា​រវាង​ទម្រង់ RAW និង JPEG។ នេះ​បើ​តាម​ការ​ស្ទង់មតិ​មួយ​ពី​វេបសាយ​ Keypoint Intelligence។\r\n\r\n<img class=\"wp-image-147 size-full aligncenter\" src=\"http://localhost/wordpress/Tokata/wp-content/uploads/2018/12/s1.png\" alt=\"\" width=\"720\" height=\"538\" />\r\n\r\nទាំង​ប្រព័ន្ធ iOS របស់ Apple និង Android របស់ Google អាច​ឲ្យ​កម្មវិធី​ទូរសព្ទ​ចាប់​យក​រូបភាព​ដើម ក្នុង​ទម្រង់ DNG (Digital Negative) របស់ Adobe ដែល​អាច​បញ្ចូល​ក្នុង​កម្មវិធី​ដូចជា Lightroom របស់ Adobe Systems, Darkroom របស់ Bergen ឬ Snapseed របស់ Google។ ដើម្បី​ថតរូប​ដើម ត្រូវការ​កម្មវិធី​ដូចជា Halide ឬ VSCO លើ iPhone, Open Camera សម្រាប់ Android, កម្មវិធី​កាមេរ៉ា​របស់ Google លើ​ទូរសព្ទ​ស៊េរី Pixel ឬ កម្មវិធី Lightroom ទាំង​លើ iOS ឬ Android។​\r\n\r\nទន្ទឹម​នឹង​អត្ថប្រយោជន៍​ដ៏​លើស​លប់​ពី​ការ​ប្រើប្រាស់​ទម្រង់​ដើម ក៏​មាន​ចំណុច​បង្អាក់​មួយ​ចំនួន​ផង​ដែរ​។\r\n<ul>\r\n 	<li>ត្រូវការ​កែប្រែ​រូបភាព​ទម្រង់​ដើម​ជា​មុន មុន​ពេល​អាច​ចែករំលែក​ជាមួយ​មិត្តភក្ដិ ឬ​ក្រុម​គ្រួសារ​។ មិនមែន​គ្រប់គ្នា​ចូលចិត្ត​ការ​កែប្រែ​រូបភាព​នោះ​ទេ​។</li>\r\n 	<li>3D Depth Maps របស់ iPhone ឬ Night Sight និង Super Res Zoom របស់​ទូរសព្ទ Pixel មិន​ទាន់​អាច​ដំណើរការ​បាន​សម្រាប់​រូបភាព​ទម្រង់​ដើម​នោះ​ទេ នា​ពេល​បច្ចុប្បន្ន​។ រី​ឯ​មុខងារ​ទប់​លំនឹង​របស់ iPhone ក៏​មិន​ទាន់​អាច​ប្រើ​បាន​នោះ​ដែរ ពេល​ថត​ប្រើ​ទម្រង់​ដើម​៕</li>\r\n</ul>', 'Google, Apple, Adobe បង្កើត​គុណភាព​រូបភាពកាន់តែឡូយ​ជាមួយ​​ទម្រង់ RAW', '', 'publish', 'closed', 'closed', '', 'google-apple-adobe-%e1%9e%94%e1%9e%84%e1%9f%92%e1%9e%80%e1%9e%be%e1%9e%8f%e2%80%8b%e1%9e%82%e1%9e%bb%e1%9e%8e%e1%9e%97%e1%9e%b6%e1%9e%96%e2%80%8b%e1%9e%9a%e1%9e%bc%e1%9e%94%e1%9e%97%e1%9e%b6', '', '', '2018-12-18 02:15:40', '2018-12-18 02:15:40', '', 0, 'http://localhost/learning/wordpress/Tokata/?p