(125, 1, '2018-12-17 08:42:10', '2018-12-17 08:42:10', 'ក្រុមហ៊ុន​គ្រប់គ្រង​លើ​ផ្នែក​​លេខ​សម្ងាត់ (Password) បាន​បង្ហាញ​ចេញ​បញ្ជី​លេខ​សម្ងាត់​អន់​បំផុត​ទាំង​ ១០០​ ប្រចាំ​ឆ្នាំ ២០១៨ ដោយ​ផ្អែក​លើ​​លេខ​សម្ងាត់​ចំនួន ៥ លាន​ដែល​​បាន​លេច​ធ្លាយ​លើ​អ៊ីនធឺណិត។ ខាង​ក្រោម​នឹង​បង្ហាញ​អំពី​ចំណាត់​ថ្នាក់​កំពូល​ទាំង ២៥ ៖\r\n\r\n<img class=\"alignnone wp-image-146 size-full\" src=\"http://localhost/wordpress/Tokata/wp-content/uploads/2018/12/p1.jpg\" alt=\"\" width=\"700\" height=\"350\" />\r\n\r\n<strong>១. 123456 (មិន​ផ្លាស់​ប្ដូរ​លេខ​វៀង​បើ​ធៀប​នឹង​ឆ្នាំ​មុន)</strong>\r\n\r\n<strong>២. password (មិន​ផ្លាស់​ប្ដូរ)</strong>\r\n\r\n<strong>៣. 123456789 (ឡើង ៣ លេខ)</strong>\r\n\r\n<strong>៤. 12345678 (ចុះ ១ លេខ)</strong>\r\n\r\n<strong>៥. 12345 (មិន​ផ្លាស់​ប្ដូរ)</strong>\r\n\r\n<strong>៦. 111111 (ថ្មី)</strong>\r\n\r\n<strong>៧. 1234567 (ឡើង ១ លេខ)</strong>\r\n\r\n<strong>៨. sunshine (ថ្មី)</strong>\r\n\r\n<strong>៩. qwerty (ចុះ ៥ លេខ)</strong>\r\n\r\n<strong>១០. iloveyou (មិន​ផ្លាស់​ប្ដូរ)</strong>\r\n\r\n<strong>១១. princess (ថ្មី)</strong>\r\n\r\n<strong>១២. admin (ចុះ ១ លេខ)</strong>\r\n\r\n<strong>១៣. welcome (ចុះ ១ លេខ)</strong>\r\n\r\n<strong>១៤. 666666 (ថ្មី)</strong>\r\n\r\n<strong>១៥. abc123 (មិនផ្លាស់​ប្ដូរ)</strong>\r\n\r\n<strong>១៦. football (ចុះ ៧ លេខ)</strong>\r\n\r\n<strong>១៧. 123123 (មិនផ្លាស់ប្ដូរ)</strong>\r\n\r\n<strong>១៨. monkey (ចុះ ៥ លេខ)</strong>\r\n\r\n<strong>១៩. 654321 (ថ្មី)</strong>\r\n\r\n២០. !@#$%^&amp;* (ថ្មី)\r\n\r\n<strong>២១. charlie (ថ្មី)</strong>\r\n\r\n<strong>២២. aa123456 (ថ្មី)</strong>\r\n\r\n<strong>២៣. donald (ថ្មី)</strong>\r\n\r\n<strong>២៤. password1 (ថ្មី)</strong>\r\n\r\n<strong>២៥. qwerty123 (ថ្មី)</strong>', 'មក​ស្គាល់​ Password អន់​បំផុត​ប្រចាំ​ឆ្នាំ ២០១៨', '', 'publish', 'closed', 'closed', '', '%e1%9e%98%e1%9e%80%e2%80%8b%e1%9e%9f%e1%9f%92%e1%9e%82%e1%9e%b6%e1%9e%9b%e1%9f%8b%e2%80%8b-password-%e1%9e%a2%e1%9e%93%e1%9f%8b%e2%80%8b%e1%9e%94%e1%9f%86%e1%9e%95%e1%9e%bb%e1%9e%8f%e2%80%8b%e1%9e%94', '', '', '2018-12-18 02:09:26', '2018-12-18 02:09:26', '', 0, 'http://localhost/learning/wordpress/Tokata/?post_type=entertain&#038;p=125', 0, 'entertain', '', 0),
