(127, 1, '2018-12-17 08:43:06', '2018-12-17 08:43:06', 'កម្មវិធី​ពិព័រណ៍​​តាំង​យន្តហោះ និង​បច្ចេកវិទ្យា​ នា​ព្រឹកមិញ​នេះ​ទទួល​បាន​ការ​ចាប់​អារម្មណ៍​ច្រើនកម្មវិធី​ពិព័រណ៍​​តាំង​យន្តហោះ និង​បច្ចេកវិទ្យា​ នា​ព្រឹកមិញ​នេះ​ទទួល​បាន​ការ​ចាប់​អារម្មណ៍​ច្រើនកម្មវិធី​ពិព័រណ៍​​តាំង​យន្តហោះ និង​បច្ចេកវិទ្យា​ នា​ព្រឹកមិញ​នេះ​ទទួល​បាន​ការ​ចាប់​អារម្មណ៍​ច្រើន\r\n\r\n<img class=\"aligncenter wp-image-142 size-large\" src=\"http://localhost/wordpress/Tokata/wp-content/uploads/2018/12/a1-1024x768.jpg\" alt=\"\" width=\"1024\" height=\"768\" />\r\n\r\n​អ្វី​​គួរ​ឱ្យ​អារម្មណ៍ក្នុង​កម្មវិធី​នេះ​ គឺ​ការប្រកួតប្រជែង​​ \"យន្ត​ហោះ​កៅស៊ូ\" ដែល​​មាន​ការ​​ចូល​រួម​ពី​សិស្ស​​ ១៤ ក្រុម។ ការប្រកួត​ធ្វើឡើងក្នុង​គោលបំណង ឱ្យសិស្សស្វែងយល់ពី​មូលដ្ឋាន​គ្រឹះខ្លះ ជំនាញឌីហ្សាញ និង​​ចំណុច​ផ្សេងៗ​ទៀត​។ ​\r\n\r\nមិន​តែ​ប៉ុណ្ណោះ​ គឺ​​ការ​បង្ហាញ​យន្តហោះ​ពិតជាច្រើនគ្រឿង ​​របស់​មូលដ្ឋាន​កងទ័ព​អាកាស​ពោធិចិនតុង, ក្រុមហ៊ុន Helistar និង​យន្តហោះឯកជន Privat Jet (មិន​បញ្ជាក់​កម្មសិទ្ធិ​) ផ្សេងទៀត។ ​អ្នក​ចូល​រួម​អាច​​ទស្សនា​រូបភាព​ខាងក្នុង​​ខាងក្រៅ និង​​​សាកសួរ​​អ្នក​ជំនាញ​បើក​យន្តហោះ ដែលប្រចាំការនៅទិនោះ ​អំពី​​លក្ខណៈ​បច្ចេកទេស​​ផ្សេងៗ​ទុកជាចំណេះ។\r\n\r\n<img class=\"aligncenter wp-image-143 size-large\" src=\"http://localhost/wordpress/Tokata/wp-content/uploads/2018/12/a2-1024x768.jpg\" alt=\"\" width=\"1024\" height=\"768\" />\r\n\r\nកាន់​តែ​ចាប់​ចិត្ត ពិព័រណ៍​​យន្តហោះ និង​បច្ចេកវិទ្យា​លើក​ទីមួយ​នេះ ដែលបើកឱ្យចូលរួមទស្សនាដោយសេរីនេះ ​ក៏​មាន​បង្ហាញ​ស្នាដៃ​បច្ចេកវិទ្យា​ប្លែកៗ​ដូចជា សម្ភារៈ​កែច្នៃ​ពី​កាកសំណល់ គ្រឿង​ចក្រ និង​រ៉ូបូត របស់​និស្សិត និង​ស្ថាប័ន​ក្រុមហ៊ុន​ឯកជន​នានា​ផង​ដែរ ​សរុប​ប្រហែល​ជា ២០​ស្ទង់។\r\n\r\nកម្មវិធី​នេះរៀបចំ​ធ្វើ​ឡើង​ដោយ​ សហព័ន្ធ​សហភាព​យុវជន​កម្ពុជា​ខេត្ត​ស្វាយរៀង សហការ​ជាមួយ STEM Cambodia និងគាំទ្រ​ដោយ​ក្រសួង​ អប់រំ ​យុវជន​ និង​កីឡា។\r\n\r\nការពិព័រណ៍យន្តហោះ និង​បច្ចេកវិទ្យា មានរយៈពេល​៣​ថ្ងៃ គឺ​ចាប់​ពី​ថ្ងៃ​ទី​ ១៤ ខែធ្នូដល់ ១៦ ខែធ្នូ ឆ្នាំ​ ២០១៨ ក្នុង​​មូលដ្ឋាន​កងទ័ពអាកាស​ពោធិចិនតុង៕\r\n\r\n<img class=\"aligncenter wp-image-144 size-large\" src=\"http://localhost/wordpress/Tokata/wp-content/uploads/2018/12/a3-1024x768.jpg\" alt=\"\" width=\"1024\" height=\"768\" />', 'ពិព័រណ៍​យន្តហោះនិង​បច្ចេកវិទ្យា​​ ទាក់ទាញសិស្សឱ្យចូលទស្សនាច្រើន​​ព្រឹកមិញ', '', 'publish', 'closed', 'closed', '', '%e1%9e%96%e1%9e%b7%e1%9e%96%e1%9f%90%e1%9e%9a%e1%9e%8e%e1%9f%8d%e2%80%8b%e1%9e%99%e1%9e%93%e1%9f%92%e1%9e%8f%e1%9e%a0%e1%9f%84%e1%9f%87%e1%9e%93%e1%9e%b7%e1%9e%84%e2%80%8b%e1%9e%94%e1%9e%85%e1%9f%92', '', '', '2018-12-18 02:02:43', '2018-12-18 02:02:43', '', 0, 'http://localhost/learning/wordpress/Tokata/?post_type=entertain&#038;p=127', 0, 'entertain', '', 0),
