(131, 1, '2018-12-17 13:58:25', '2018-12-17 13:58:25', 'Year after year, Glastonbury is a sell-out success story. This is one event that really doesn’t have to worry too much about self-promotion. But does that stop it from having a regularly updated blog? It does not.\r\n\r\nThe Glastonbury blog is, in fact, a good example of an event blog that keeps up the momentum all year round and does an especially good job of post-event coverage.\r\n\r\nSince the festivalgoers packed up their tents on June 28, they’ve released scores of fabulous event photos and exclusive highlight videos, encouraged attendees to share their own content, as well as promoted merchandise and special offers for future events. That’s music to our ears!', 'Glastonbury Festival', '', 'publish', 'closed', 'closed', '', 'glastonbury-festival', '', '', '2018-12-17 14:00:04', '2018-12-17 14:00:04', '', 0, 'http://localhost/learning/wordpress/Tokata/?post_type=event&#038;p=131', 0, 'event', '', 0),
(132, 1, '2018-12-17 13:59:55', '2018-12-17 13:59:55', '', 'e1', '', 'inherit', 'open', 'closed', '', 'e1', '', '', '2018-12-17 13:59:55', '2018-12-17 13:59:55', '', 131, 'http://localhost/learning/wordpress/Tokata/wp-content/uploads/2018/12/e1.png', 0, 'attachment', 'image/png', 0),
(133, 1, '2018-12-17 14:12:13', '2018-12-17 14:12:13', 'When you’re working with a topic as evocative as weddings, it’s easy to build a vibrant and exciting blog. However, the blog for The National Wedding Show, which takes place at London Olympia every September, really is the blushing bride.\r\n\r\nIt grabs your attention from the off, with a prominent slider featuring the top stories. It’s got a ‘trending’ side bar and eye-catching category selection, meanwhile each post preview boasts great imagery and bold social share buttons.\r\n\r\nWhat’s more, before you can even read the blog, you’re served with a pop-up encouraging you to register for the event’s mailing list. Is this annoying? No, because it’s offering the visitor the chance to win a dream wedding dress worth up to £3,000. What girl wouldn’t say ‘yes’ to that proposal?', 'The National Wedding Fair', '', 'publish', 'closed', 'closed', '', 'the-national-wedding-fair', '', '', '2018-12-17 14:12:13', '2018-12-17 14:12:13', '', 0, 'http://localhost/learning/wordpress/Tokata/?post_type=event&#038;p=133', 0, 'event', '', 0),
(134, 1, '2018-12-17 14:12:07', '2018-12-17 14:12:07', '', 'e2', '', 'inherit', 'open', 'closed', '', 'e2', '', '', '2018-12-17 14:12:07', '2018-12-17 14:12:07', '', 133, 'http://localhost/learning/wordpress/Tokata/wp-content/uploads/2018/12/e2.png', 0, 'attachment', 'image/png', 0),
(135, 1, '2018-12-17 14:12:53', '2018-12-17 14:12:53', 'The Mind Body Spirit Festival is the biggest and longest running exhibition entirely devoted to the pursuit of healthier, more creative and fulfilling lifestyles.\r\n\r\nThe Mind Body Spirit blog is a really great example of using guest bloggers to produce content and do the hard work for you. The organisers have asked every speaker involved with the event to write an inspiring long-form blog post related to their session topic.\r\n\r\nThe result is a treasure trove of Google-friendly content that draws the reader in, gets them interested in the subject matter and then hits them with the session date and time. Each post concludes with a link to buy tickets and a prompt to follow the event’s other social media channels. That’s got to be good karma.', 'The Mind Body Spirit Festival', '', 'publish', 'closed', 'closed', '', 'the-mind-body-spirit-festival', '', '', '2018-12-17 14:12:53', '2018-12-17 14:12:53', '', 0, 'http://localhost/learning/wordpress/Tokata/?post_type=event&#038;p=135', 0, 'event', '', 0),
(136, 1, '2018-12-17 14:12:48', '2018-12-17 14:12:48', '', 'e3', '', 'inherit', 'open', 'closed', '', 'e3', '', '', '2018-12-17 14:12:48', '2018-12-17 14:12:48', '', 135, 'http://localhost/learning/wordpress/Tokata/wp-content/uploads/2018/12/e3.png', 0, 'attachment', 'image/png', 0),
(137, 1, '2018-12-17 14:13:29', '2018-12-17 14:13:29', 'Staged annually at ExCeL in London, World Travel Market (WTM) is the leading global event for the travel industry, presenting a diverse range of destinations and industry sectors to UK and International travel professionals.\r\n\r\nThe WTM blog reflects the broad range of sectors the event covers, with fresh content posted most days, ensuring there’s something for everyone. The blog is broken down into a variety of categories, spanning luxury travel to medical tourism.\r\n\r\nThis makes it really user-friendly, with attendees from all the different sectors able to easily locate the news most relevant to them, so there’s no need to trot the globe.', 'World Travel Market', '', 'publish', 'closed', 'closed', '', 'world-travel-market', '', '', '2018-12-17 14:13:29', '2018-12-17 14:13:29', '', 0, 'http://localhost/learning/wordpress/Tokata/?post_type=event&#038;p=137', 0, 'event', '', 0),
(138, 1, '2018-12-17 14:13:24', '2018-12-17 14:13:24', '', 'e4', '', 'inherit', 'open', 'closed', '', 'e4', '', '', '2018-12-17 14:13:24', '2018-12-17 14:13:24', '', 137, 'http://localhost/learning/wordpress/Tokata/wp-content/uploads/2018/12/e4.png', 0, 'attachment', 'image/png', 0),
(139, 1, '2018-12-17 14:14:13', '2018-12-17 14:14:13', 'Taking place twice a year at Birmingham NEC, Moda is the UK’s largest business-to-business fashion event, welcoming more than 1,450 brands and 12,000 visitors each season.\r\n\r\nFeaturing a really great mix of show-based content, Moda’s blog delivers added value for exhibitors. Content ranges from exhibitor news, profiles and Q&amp;As, through to special offers, guest blogs and topical and educational pieces.\r\n\r\nIt’s all accompanied by stylish images (of course, that’s somewhat easier when you’re in the fashion biz) and laid out in a clear and easy-to-read format. Definitely a well-dressed blog.', 'MODA', '', 'publish', 'closed', 'closed', '', 'moda', '', '', '2018-12-17 14:14:13', '2018-12-17 14:14:13', '', 0, 'http://localhost/learning/wordpress/Tokata/?post_type=event&#038;p=139', 0, 'event', '', 0),
