(148, 1, '2018-12-18 02:15:37', '2018-12-18 02:15:37', 'ស្មាតហ្វូន Pixel 3 របស់ Google, កម្មវិធី Lightroom របស់ Adobe និង iPhone ម៉ូដែល​ថ្មី សុទ្ធតែ​មាន​ការ​ចិត្ត​ទុក​ដាក់​ជាមួយ​នឹង​ទម្រង់​រូបភាព​ដើម​នេះ​។\n\nក្នុង​ចំណោម​អ្នក​ថតរូប​អាជីព ១ ៨០០​នាក់​នៅ​សហរដ្ឋអាមេរិក មាន ៦៨% ថត​ប្រើ​ទម្រង់ RAW, ២០% ថត​លាយ​គ្នា​រវាង​ទម្រង់ RAW និង JPEG។ នេះ​បើ​តាម​ការ​ស្ទង់មតិ​មួយ​ពី​វេបសាយ​ Keypoint Intelligence។\n\n<img class=\"wp-image-147 size-full aligncenter\" src=\"http://localhost/wordpress/Tokata/wp-content/uploads/2018/12/s1.png\" alt=\"\" width=\"720\" height=\"538\" />\n\n&nbsp;', 'Google, Apple, Adobe បង្កើត​គុណភាព​រូបភាពកាន់តែឡូយ​ជាមួយ​​ទម្រង់ RAW', '', 'inherit', 'closed', 'closed', '', '123-autosave-v1', '', '', '2018-12-18 02:15:37', '2018-12-18 02:15:37', '', 123, 'http://localhost/wordpress/Tokata/2018/12/18/123-autosave-v1/', 0, 'revision', '', 0),
